CREATE OR REPLACE FUNCTION transport_protocol_port_insertdefaultdata(vm transport_protocol_port)
  RETURNS integer AS
$BODY$
declare
	vm_id integer;
BEGIN
	select id into vm_id from transport_protocol_port where portnumber=vm.portnumber and protocol=vm.protocol;
	
	if vm_id IS NULL THEN
		insert into transport_protocol_port(
			servername, portnumber, protocol, description)
			values( 
			vm.servername, vm.portnumber, vm.protocol, vm.description
			);
			return lastval();
	end if;
	return -1;
EXCEPTION
	WHEN OTHERS THEN 
		RETURN -2;	
END;

  $BODY$
  LANGUAGE 'plpgsql' VOLATILE
  COST 100;
